import styled from "styled-components";

const ProfileStyle = styled.div`
  background: #fff;
  min-height: 100vh;
  padding: 100px 400px;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

export default ProfileStyle;
